INSERT INTO `experiment_test_steps` VALUES ('av1_inject',30,'av1_data_trans','inject new data to the stream','','injecting data to the stream which is purely created by an attacker and not generated by the benign origin'),('av1_replay',10,'av1_data_trans','finding some way to replay information to the server','','can information be captured and replayed to the server?\r\nis the server accepting such information?\r\nsession steeling and tampering?\r\nsome kind of CSRF attacks which will write information to a victims account and which details are required to capture in order to enable such attacks?'),('av1_ssl_forg',50,'av1_data_trans','secure and correct implementation of communication encryption','','analysing for any flaws in SSL implementations or no-SSL\r\n\r\nthis step tries to forge a new certificate, so that if certificate validation is not correctly implemented in the application, the forged certificate will be accepted and an attacker can spoof data'),('av1_ssl_forg_ca',60,'av1_data_trans','in addition to data_com_ssl_forg the trusted CA certificate is installed','','this attack can only be defeated by certificate pinning\r\n\r\notherwise an attacker will be able to spoof on data'),('av1_tamper',20,'av1_data_trans','tampering the data before it can reach the server defeating input validation','','tampering data before it can reach the server by intercepting requests;\r\n\r\ndoes the server employ input validation on the web service?\r\n\r\nfind ways to harm data integrity'),('av2_export_backup',10,'av2_mobile_device','data is being backed up using the android backup command','','is there any not encrypted data as part of the backups\r\n\r\nincludes SQLite databases\r\n\r\ncache files or log files'),('av2_export_logging',20,'av2_mobile_device','investigate the Android log for unencrypted information','','using ADB logcat enables access to a phones log files and these can potentially hold unencrypted logging information'),('av3_code_comment',120,'av3_mobile_app','any comment on the code','','while manually investigating the code any comment required to be documented goes in here'),('av3_data_coll',20,'av3_mobile_app','data collected and send by the mobile app','','which data is being collected by the phone and send to any kind of web server\r\nthis includes the data the mobile app might have received from the sensor device'),('av3_data_leakage',100,'av3_mobile_app','identifiable for the user or the phone that is being collected','','data can include any unique identifier for Android such as IMEI, MAC, advertising ID and others'),('av3_data_wipe',90,'av3_mobile_app','can data be wiped from the mobile application','true / false',NULL),('av3_export_cloud',20,'av3_mobile_app','data being exported somewhere into the cloud (dropbox et al)','',NULL),('av3_export_sdcard',10,'av3_mobile_app','can data be exported to SD card or other locations on device and is that data encrypted','',NULL),('av3_export_social',30,'av3_mobile_app','export variants to social media and data encryption while exporting','',NULL),('av3_pwd_change_freq',10,'av3_mobile_app','password change period (must) and frequency (can)','0 no rule\r\n1 rule but not reasonable (> 90 days)\r\n2 rule and reasonable (< 90 days)','this should enforce changing passwords and prevent users from changing passwords to frequently; frequently passwords might bypass history requirements'),('av3_pwd_change_policy',40,'av3_mobile_app','password policy enforced on password change','','which password policy is applied on password change\r\nwhat are the characteristics'),('av3_pwd_change_reuse',20,'av3_mobile_app','can a password be reused and how much difference is required','0 - yes, unlimited\r\n1 - no, but history can be bypassed (see change freq)\r\n2 - no without limitation',NULL),('av3_reg_acc_verif',50,'av3_mobile_app','email account verification or two factor authentication','0 / none\r\n1 / email account verification\r\n2 / two factor authentication',NULL),('av3_reg_data_input',10,'av3_mobile_app','Specifies the data fields and types which are required as inputs','no specific rating here, this is for information collection only',NULL),('av3_reg_data_validation',20,'av3_mobile_app','Comments on data validation during user registration: weight, heitght, email...','true/false with comments on specific fields',NULL),('av3_reg_pripol_link',40,'av3_mobile_app','link to privacy policy or any kind of information on such topic','true / false',NULL),('av3_reg_pwd_policy',30,'av3_mobile_app','is a password policy enforced','','a password policy can be characterised as follows\r\n- minimum length\r\n- character sets (lower, upper, digit, special)\r\n- well-known patterns (date of birth, username, family name)'),('av4_data_leakage',10,'av4_third_party','data leakage to third party services','','names the service and describes the characteristics of the data being leaked to that service'),('av5_data_coll',10,'av5_sensor_device','characteristics of data collected by the sensor','','which data is collected by the sensor and transmitted'),('av5_pairing_process',30,'av5_sensor_device','pairing process between sensor and phone','','describes the pairing process between the sensor and phone towards security features such as pin based pairing and other BLE protocol features;\r\nmany devices omit the correct bluetooth paring and instantaneously communicate via BLE '),('av5_swfw_update',10,'av5_sensor_device','update cycle related issues','','firmware may be captured or replaced'),('av6_csrf',120,'av6_web_application','basic CSRF attack','0 - vulnerable\r\n1 - not vulnerable',NULL),('av6_data_input',100,'av6_web_application','data input via web UI and validation','',NULL),('av6_data_wipe',90,'av6_web_application','wipe and delete data from the web account','true / false',NULL),('av6_export_cloud',20,'av6_web_application','data being exported somewhere into the cloud (dropbox et al)','',NULL),('av6_export_disk',10,'av6_web_application','can data be exported 