INSERT INTO `experiments` VALUES (93,'com.withings.wiscale2','2016-07-11 19:49:01','av3_mobile_app','setting up the withings scale and saw some weird input validations (details in test cases)','/media/exthdd/experiments/com.withings.wiscale2/av3_mobile_app/2016-07-11_20:49:01'),(97,'com.withings.wiscale2','2016-07-12 09:26:03','av5_sensor_device','first tried to setup scale using bluetooth but didnt work; then tried via wifi and would work; traffic from scale to withings webserver is http only; possibly can be exploited for replay attacks as well; maybe firmware update will defeat the http vulnerability as the scale partly communicates via https','/media/exthdd/experiments/com.withings.wiscale2/av5_sensor_device/2016-07-12_10:26:03'),(98,'com.withings.wiscale2','2016-07-12 10:06:52','av5_sensor_device','collected data from scale and successfully uploaded to withings; added a new user within the same account, but withings offers as well to associate the same scale with different accounts; replay attacks are likely to be successful','/media/exthdd/experiments/com.withings.wiscale2/av5_sensor_device/2016-07-12_11:06:52'),(113,'com.withings.wiscale2','2016-07-12 16:54:00','av3_mobile_app','some manual entry added and uploaded to withings server','/media/exthdd/experiments/com.withings.wiscale2/av3_mobile_app/2016-07-12_17:57:54'),(178,'com.microsoft.kapp','2016-07-08 10:35:59','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.microsoft.kapp/av1_data_trans/2016-07-08_11:35:59'),(179,'com.jawbone.upopen','2016-07-08 10:39:29','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.jawbone.upopen/av1_data_trans/2016-07-08_11:39:29'),(180,'fi.polar.polarflow','2016-07-08 10:40:41','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/fi.polar.polarflow/av1_data_trans/2016-07-08_11:40:41'),(181,'com.veclink.movnow.healthy_q2','2016-07-08 10:41:48','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.veclink.movnow.healthy_q2/av1_data_trans/2016-07-08_11:41:48'),(182,'com.withings.wiscale2','2016-07-08 10:42:42','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.withings.wiscale2/av1_data_trans/2016-07-08_11:42:42'),(183,'com.activ8rlives.mobile','2016-07-08 10:43:42','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.activ8rlives.mobile/av1_data_trans/2016-07-08_11:43:42'),(184,'com.medm.medmwt.diary','2016-07-08 10:44:07','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.medm.medmwt.diary/av1_data_trans/2016-07-08_11:44:07'),(185,'com.stabxtom.thomson','2016-07-08 10:45:29','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.stabxtom.thomson/av1_data_trans/2016-07-08_11:45:29'),(186,'com.fitbit.FitbitMobile','2016-07-08 10:46:10','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.fitbit.FitbitMobile/av1_data_trans/2016-07-08_11:46:10'),(187,'com.zensorium.tinke','2016-07-08 11:06:17','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.zensorium.tinke/av1_data_trans/2016-07-08_12:06:17'),(188,'com.garmin.android.apps.connectmobile','2016-07-08 11:21:37','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.garmin.android.apps.connectmobile/av1_data_trans/2016-07-08_12:21:37'),(189,'com.mioglobal.android.miogo','2016-07-08 11:24:40','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.mioglobal.android.miogo/av1_data_trans/2016-07-08_12:24:40'),(190,'com.hapiconnect','2016-07-08 15:57:45','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.hapiconnect/av1_data_trans/2016-07-08_16:57:45'),(191,'com.ks.wristband','2016-07-08 16:23:45','av1_data_trans','aggregated from teststeps','/media/exthdd/experiments/com.ks.wristband/av1_data_trans/2016-07-08_17:23:45'),(196,'com.withings.wiscale2','2016-07-12 20:41:27','av1_data_trans','tampered with data and executed some replay attacks; data is not validated and can cause server errors if weight to high','/media/exthdd/experiments/com.withings.wiscale2/av1_data_trans/2016-07-12_21:41:27'),(198,'com.withings.wiscale2','2016-07-13 07:42:31','av5_sensor_device','manipulated request for firmware and got link to update.. firmware can be downloaded','/media/exthdd/experiments/com.withings.wiscale2/av5_sensor_device/2016-07-13_08:42:31'),(205,'com.withings.wiscale2','2016-07-12 08:19:52','av3_mobile_app','aggregated from teststeps','/media/exthdd/experiments/com.withings.wiscale2/av3_mobile_app/2016-07-12_09:19:52'),(206,'com.withings.wiscale2','2016-07-13 11:34:27','sol_arch','scale can connect via wifi and bluetooth wifi option enables scale to communicate with withings immediately wifi option is using http only phone is loading data from webservice scale is set up via bluetooth, this way it is provided with parameter',''),(210,'com.withings.wiscale2','2016-07-13 14:40:55','av2_mobile_device','run the app to synchronize and export app data to disk for further investigation','/media/exthdd/experiments/com.withings.wiscale2/av2_mobile_device/2016-07-13_15:40:55'),(241,'com.withings.wiscale2','2016-07-14 14:51:01','av3_mobile_app','password change and export tests','/media/exthdd/experiments/com.withings.wiscale2/av3_mobile_app/2016-07-14_15:51:01'),(248,'com.withings.wiscale2','2016-07-14 15:38:25','av6_web_application','investigate if account can be delete with spoofed information --> account can\'t be deleted with stolen session id from unencrypted sensor device communication','/media/exthdd/experiments/com.withings.wiscale2/av6_web_application/2016-07-14_16:38:25'),(259,'com.stabxtom.thomson','2016-07-15 13:05:04','av3_mobile_app','ran regestration test steps','/media/exthdd/experiments/com.stabxtom.thomson/av3_mobile_app/2016-07-15_14:05:04'),(261,'com.stabxtom.thomson','2016-07-15 16:05:54','av3_mobile_app','paired the scale with the app','/media/exthdd/experiments/com.stabxtom.thomson/av3_mobile_app/2016-07-15_17:05:54'),(263,'com.stabxtom.thomson','2016-07-15 16:14:56','av5_sensor_device','collected some data by weighting and sending data to web server','/media/exthdd/experiments/com.stabxtom.thomson/av5_sensor_device/2016-07-15_17:14:56'),(265,'com.stabxtom.thomson','2016-07-15 16:38:53','av2_mobile_device','found way too much information in the device logs','/media/exthdd/experiments/com.stabxtom.thomson/av2_mobile_device/2016-07-15_17:38:53'),(271,'com.stabxtom.thomson','2016-07-16 11:43:57','av1_data_trans','tried to tamper with traffic by manipulating requests and stealing the session to use it to inject further measurements; however data couldnt be synchroniyed back into the application (even after deleting all app data the app doesnt intially download all dataa from server; previous measurements are simply lost','/media/exthdd/experiments/com.stabxtom.thomson/av1_data_trans/2016-07-16_12:43:57'),(274,'com.stabxtom.thomson','2016-07-16 12:39:20','sol_arch','measurements from the scale are first inserted into the database and then synchronized to a server (data center); however once the data has been synchronized to that server it is not any longer accessible for the user; the app after reset does not load the already collected data initially',NULL),(276,'com.stabxtom.thomson','2016-07-16 13:20:46','av3_mobile_app','tried some input validations, injection, tampering by manually adding data','/media/exthdd/experiments/com.stabxtom.thomson/av3_mobile_app/2016-07-16_14:20:46'),(278,'com.stabxtom.thomson','2016-07-16 13:33:36','av3_mobile_app','check the password change process and turns out that an attacker can change the victims password at any point in time after the victim opened the app and the attacker was listening to the traffic and hence able to steal the current password hash','/media/exthdd/experiments/com.stabxtom.thomson/av3_mobile_app/2016-07-16_14:33:36'),(284,'com.stabxtom.thomson','2016-07-16 14:23:00','av3_mobile_app','password change via email link on not secure website','/media/exthdd/experiments/com.stabxtom.thomson/av3_mobile_app/2016-07-16_15:23:00'),(286,'com.activ8rlives.mobile','2016-07-16 15:11:26','av3_mobile_app','setting up user account and checking password policies','/media/exthdd/experiments/com.activ8rlives.mobile/av3_mobile_app/2016-07-16_16:11:26'),(294,'com.activ8rlives.mobile','2016-07-16 17:11:53','av5_sensor_device','connected scale and did some measurements','/media/exthdd/experiments/com.activ8rlives.mobile/av5_sensor_device/2016-07-16_18:11:53'),(296,'com.activ8rlives.mobile','2016-07-16 17:45:36','av1_data_trans','executing attacks on traffic to reveal that most of the messages are not authenticated at all; also passwords are transmitted in clear text','/media/exthdd/experiments/com.activ8rlives.mobile/av1_data_trans/2016-07-16_18:45:36'),(298,'com.activ8rlives.mobile','2016-07-16 18:01:30','av4_third_party','leakage of data to xamarin','/media/exthdd/experiments/com.activ8rlives.mobile/av4_third_party/2016-07-16_19:01:30'),(300,'com.activ8rlives.mobile','2016-07-16 18:10:20','av2_mobile_device','used some basic app functions to generate data','/media/exthdd/experiments/com.activ8rlives.mobile/av2_mobile_device/2016-07-16_19:10:20'),(306,'com.activ8rlives.mobile','2016-07-17 08:16:05','av6_web_application','basic ellaboration of the web page','/media/exthdd/experiments/com.activ8rlives.mobile/av6_web_application/2016-07-17_09:16:05'),(316,'com.activ8rlives.mobile','2016-07-17 09:53:43','av6_web_application','user registration via web page','/media/exthdd/experiments/com.activ8rlives.mobile/av6_web_application/2016-07-17_10:53:43'),(344,'com.medm.medmwt.diary','2016-07-18 13:29:47','av3_mobile_app','registered user and provided some basic data','/media/exthdd/experiments/com.medm.medmwt.diary/av3_mobile_app/2016-07-18_14:29:47'),(352,'com.medm.medmwt.diary','2016-07-18 14:01:37','av5_sensor_device','paired device and did some measurements','/media/exthdd/experiments/com.medm.medmwt.diary/av5_sensor_device/2016-07-18_15:01:37'),(354,'com.medm.medmwt.diary','2016-07-18 14:15:40','av1_data_trans','ran some attacks against the data in transmission','/media/exthdd/experiments/com.medm.medmwt.diary/av1_data_trans/2016-07-18_15:15:40'),(356,'com.medm.medmwt.diary','2016-07-18 14:38:38','av4_third_party','no data leakage found','/media/exthdd/experiments/com.medm.medmwt.diary/av4_third_party/2016-07-18_15:38:38'),(358,'com.medm.medmwt.diary','2016-07-18 14:39:37','av2_mobile_device','looking for data leakage','/media/exthdd/experiments/com.medm.medmwt.diary/av2_mobile_device/2016-07-18_15:39:37'),(360,'com.medm.medmwt.diary','2016-07-18 14:50:17','av6_web_application','explored web access','/media/exthdd/experiments/com.medm.medmwt.diary/av6_web_application/2016-07-18_15:50:17'),(362,'com.medm.medmwt.diary','2016-07-18 15:11:31','av6_web_application','tested for csrf vulnerability','/media/exthdd/experiments/com.medm.medmwt.diary/av6_web_application/2016-07-18_16:11:31'),(364,'com.hapiconnect','2016-07-18 16:25:59','av3_mobile_app','registered user and setup app','/media/exthdd/experiments/com.hapiconnect/av3_mobile_app/2016-07-18_17:25:59'),(366,'com.hapiconnect','2016-07-18 16:47:27','av3_mobile_app','change passwords and analysed traffic','/media/exthdd/experiments/com.hapiconnect/av3_mobile_app/2016-07-18_17:47:27'),(368,'com.hapiconnect','2016-07-18 17:14:29','av5_sensor_device','paired scale but the app ended up in some loop sending the same request infintely','/media/exthdd/experiments/com.hapiconnect/av5_sensor_device/2016-07-18_18:14:29'),(370,'com.hapiconnect','2016-07-18 17:19:58','av5_sensor_device','','/media/exthdd/experiments/com.hapiconnect/av5_sensor_device/2016-07-18_18:19:58'),(372,'com.hapiconnect','2016-07-18 17:26:58','av1_data_trans','delete','/media/exthdd/experiments/com.hapiconnect/av1_data_trans/2016-07-18_18:26:58'),(374,'com.hapiconnect','2016-07-18 17:56:25','av4_third_party','investigating data leakage','/media/exthdd/experiments/com.hapiconnect/av4_third_party/2016-07-18_18:56:25'),(376,'com.hapiconnect','2016-07-18 17:58:28','av2_mobile_device','investigating the device','/media/exthdd/experiments/com.hapiconnect/av2_mobile_device/2016-07-18_18:58:28'),(378,'com.hapiconnect','2016-07-19 10:15:53','av6_web_application','delete','/media/exthdd/experiments/com.hapiconnect/av6_web_application/2016-07-19_11:15:53'),(380,'com.hapiconnect','2016-07-19 10:16:25','av6_web_application','investigated web page','/media/exthdd/experiments/com.hapiconnect/av6_web_application/2016-07-19_11:16:25');
