INSERT INTO `experiments_details` VALUES (1,93,'av3_reg_acc_verif','there is no trace of account verification\r\nnot even a single email was received\r\n\r\nassumption that this might be solution dependent as the withings watch caused a lot of spam in the inbox','0'),(2,93,'av3_reg_data_input','select scale n email and password n firstname, lastname, birthdate, height, weight','n/a'),(3,93,'av3_reg_data_validation','email adress is validated n password provided A n very high weights are not allowed 600lb but weird error message n height is accepted at 3m',''),(4,93,'av3_reg_pripol_link','link to privacy policy is provided\r\n\r\nhttp://www.withings.com/uk/en/legal\r\n\r\nalso terms and conditions but both links are pointing to the same webpage',''),(5,93,'av3_reg_pwd_policy','no hint to any kind of password policy could be found',''),(21,98,'av5_data_coll','data is being transmitted via http only scale is able to display the weather of the day other then that it just collects a measurements with a UNIX timestamp and the weight in g this a JSON document being posted to the server also location information is send to the scale and used by it; this communication is encrypted',''),(22,113,'av3_data_coll','added entry manually to be uploaded to server API with server seems to be different from the scales API query parameters instead of body but everything is SSL encrypted some input validation inside the mobile application is done',''),(25,178,'av1_ssl_forg_ca','working - username and password in body',''),(26,179,'av1_ssl_forg_ca','working - username and password in body',''),(27,180,'av1_ssl_forg_ca','working - username and password in body',''),(28,181,'av1_ssl_forg_ca','no SSL',''),(29,182,'av1_ssl_forg_ca','working',''),(30,183,'av1_ssl_forg_ca','working as without CA certificate',''),(31,184,'av1_ssl_forg_ca','not working',''),(32,185,'av1_ssl_forg_ca','NO SSL',''),(33,186,'av1_ssl_forg_ca','working',''),(34,187,'av1_ssl_forg_ca','working',''),(35,188,'av1_ssl_forg_ca','working - some kind of SSO going on',''),(36,189,'av1_ssl_forg_ca','working',''),(37,190,'av1_ssl_forg_ca','NO SSL - username in cleartext and password somehow encrypted or obfuscated',''),(38,191,'av1_ssl_forg_ca','working but not using internet; just checking for firmware updates',''),(40,178,'av1_ssl_forg','not working',''),(41,179,'av1_ssl_forg','not working',''),(42,180,'av1_ssl_forg','not working',''),(43,181,'av1_ssl_forg','working (!) no SSL -- also username in clear text and password is somehow encrypted',''),(44,191,'av1_ssl_forg','is working -- but just one request going out; not sure if it will synchronize any data to some place',''),(45,182,'av1_ssl_forg','not working',''),(46,183,'av1_ssl_forg','working - username and password in message body clear text',''),(47,184,'av1_ssl_forg','not working',''),(48,185,'av1_ssl_forg','working - username in clear text, mobile id and password somehow encrypted or obfuscated',''),(49,186,'av1_ssl_forg','not working',''),(50,187,'av1_ssl_forg','not working',''),(51,188,'av1_ssl_forg','not working; but also no information to the user',''),(52,189,'av1_ssl_forg','not working - but app can be used in an offline mode',''),(53,190,'av1_ssl_forg','no SSL usage',''),(55,196,'av1_replay','replay attacks are possible within the same session session is requested based on a once which is used to generate a hash the server is able to use that hash to identify the user and sends user information including a valid session key',''),(56,196,'av1_tamper','data can be changed and apparently the server is not validating the data so that unplausible data can be entered tried to change the user ID so that the data would be inserted into a different account -> that however was not successful',''),(58,198,'av5_swfw_update','scale asks server if any firmware update is available and provides the currently installed version intercepting this request and changing the firmware yields a link to an update send by server',''),(66,210,'av2_export_backup','database is available and data can be read in clear text',''),(67,93,'av3_reg_acc_verif','there is no trace of account verification\nnot even a single email was received\n\nassumption that this might be solution dependent as the withings watch caused a lot of spam in the inbox','0'),(68,210,'av2_export_logging','no information written to logcat',''),(73,241,'av3_data_wipe','no possibility to wipe data from app or from device, no way to delete account','false'),(74,241,'av3_data_coll','manual entries are possible; no othe\nseems to be transmitted',''),(75,241,'av3_export_cloud','no export option in app',''),(76,241,'av3_export_sdcard','no export option',''),(77,241,'av3_export_social','sharing is just inviting and as such possible to gmail, drive, bluetooth and android beam',''),(78,113,'av3_pwd_change_freq','n/a ','n/a'),(79,113,'av3_pwd_change_policy','n/a','n/a'),(80,113,'av3_pwd_change_reuse','n/a','n/a'),(81,248,'av6_pwd_change_freq','no frequency enforced','0'),(82,248,'av6_pwd_change_policy','min 6 char; any char no type enforcement',''),(83,248,'av6_pwd_change_reuse','unlimited reuse','0'),(84,248,'av6_reg_acc_verif','no verification','0'),(86,248,'av6_reg_data_input','same as mobile app',''),(87,248,'av6_reg_data_validation','some data validation for height and weight',''),(88,248,'av6_reg_pripol_link','yes','true'),(89,248,'av6_reg_pwd_policy','min 6 char',''),(91,248,'av6_data_wipe','account can be deleted but has 7 days period before they claim that data will actually be removed from their systems','true'),(92,248,'av6_export_cloud','n/a',''),(93,248,'av6_export_disk','only after account deletion data can be downloaded',''),(94,248,'av6_export_social','no hint that data can be shared online',''),(96,259,'av3_reg_pwd_policy','6-16 characters',''),(97,259,'av3_reg_data_input','email, password, name, gender, name, birthday, height, weight, waistline, picture',''),(98,259,'av3_reg_data_validation','limited values for weight, height, waistline, age','true'),(99,259,'av3_reg_pwd_policy','no privay policy link shown during registration',''),(100,259,'av3_reg_acc_verif','no verification email received','0'),(101,259,'av3_data_leakage','!! advertising librariy Umeng detected.. library is sending a full device fingerprint including IMEI and MAC (where it cant retrieve the MAC because of Android 6 changes)','!!'),(102,259,'av3_data_leakage','password (encrypted) and email send over unencrypted network; password seems to be some kind of 16byte hash.. tried a few tools to get the pattern and repoduce it but so far without success',''),(103,261,'av3_data_leakage','reveals full details during pairing as serial numbers, device hardware version, software version and some specific password are sent unencryted',''),(104,265,'av2_export_logging','logcat shows detailed logs with even some information on the recorded data and partly http traces\nbluetooth connection management is shown in full including MAC addresses which are logged and saved',''),(105,265,'av2_export_backup','backup contains unencrypted database which includes all information from measurements to device information',''),(106,265,'av2_export_backup','information on session and any credentials can be picked up from the shared prefs folder',''),(107,261,'av3_reg_pripol_link','no link to privacy policy apparent','false'),(108,271,'av1_replay','replay attacks are perfectly possible even with stolen session ID.. however the generated data seems to be unaccessible to the user','bad'),(109,271,'av1_tamper','data can be easily changed and is happily accepted by the server','bad'),(110,261,'av3_code_comment','code shows many different frameworks and addons integrated with the solution (also see addons table)\nthe app itself shows less possibilities to make actually use of these frameworks and addons\nthe password seems to be MD5 hashed but since the communication is not encrypted and the hash is not randomiyed that is pointless, simply use the hash value to execute a